import React from 'react'
import { Stack, Typography } from '@mui/material'
import iconf from '../assets/images/iconf.png'

const BodyPart = () => {
  return (
    <Stack>
        <img src={iconf} alt="icon"  style={{width: '200px', height: '160px'}}/>
    </Stack>
  )
}

export default BodyPart
